CREATE DEFINER=`root`@`192.168.1.176` PROCEDURE `spAccountsViewAllOrSeacrh` (`LibraryToLoad` VARCHAR(20), `SearchText` VARCHAR(40), `UT` VARCHAR(30), `PW` VARCHAR(100))  BEGIN
	CASE LibraryToLoad
		WHEN 'LOGIN' THEN
			Select * from vloginverificators WHERE UserID=BINARY(UT) AND Password=BINARY(PW);
        WHEN 'LOAD' THEN
			Select * from vloginverificators WHERE UserType=UT AND (SearchText=''
			OR USERID  LIKE  CONCAT('%',SearchText , '%')
			OR Status  LIKE  CONCAT('%',SearchText , '%')) ORDER BY USERID;
	END CASE;
END$$

