CREATE DEFINER=`root`@`192.168.1.176` PROCEDURE `spDynamicClassFiltering` (`SearchText` VARCHAR(50), `Term` CHAR(5), `Period` VARCHAR(20), `Course` VARCHAR(100), `YearLevel` CHAR(5), `Sec` CHAR(5))  BEGIN
		IF SEC='' AND YEARLEVEL='' THEN
			SELECT
				*
			FROM 
				vPeriodMashedUp
			WHERE
				Term=Term AND Code=Period AND CourseTitle=Course AND ClassCode<>'' AND
				(SearchText='' OR Term LIKE  CONCAT('%',SearchText , '%') OR Code LIKE  CONCAT('%',SearchText , '%') OR CourseTitle LIKE  CONCAT('%',SearchText , '%') OR	StudentYear LIKE  CONCAT('%',SearchText , '%') OR Section LIKE  CONCAT('%',SearchText , '%') OR StudentYear LIKE  CONCAT('%',SearchText , '%') OR CLASSCODE LIKE  CONCAT('%',SearchText , '%') OR TEACHER LIKE  CONCAT('%',SearchText , '%') OR ADVISER LIKE  CONCAT('%',SearchText , '%') )
			ORDER BY
				StudentYear,ClassCode
				;
		ELSEIF SEC=''THEN
			SELECT
				*
			FROM 
				vPeriodMashedUp
			WHERE
				Term=Term AND Code=Period AND	 CourseTitle=Course AND	 StudentYear=YearLevel AND ClassCode<>'' AND
				(SearchText='' OR Term LIKE  CONCAT('%',SearchText , '%') OR Code LIKE  CONCAT('%',SearchText , '%') OR CourseTitle LIKE  CONCAT('%',SearchText , '%') OR	StudentYear LIKE  CONCAT('%',SearchText , '%') OR Section LIKE  CONCAT('%',SearchText , '%') OR StudentYear LIKE  CONCAT('%',SearchText , '%') OR CLASSCODE LIKE  CONCAT('%',SearchText , '%') OR TEACHER LIKE  CONCAT('%',SearchText , '%') OR ADVISER LIKE  CONCAT('%',SearchText , '%') )
			ORDER BY
				ClassCode;
		ELSEIF YEARLEVEL='' THEN
			SELECT
				*
			FROM 
				vPeriodMashedUp
			WHERE
				Term=Term AND Code=Period AND	 CourseTitle=Course  AND Section=Sec AND ClassCode<>'' AND
				(SearchText='' OR Term LIKE  CONCAT('%',SearchText , '%') OR Code LIKE  CONCAT('%',SearchText , '%') OR CourseTitle LIKE  CONCAT('%',SearchText , '%') OR	StudentYear LIKE  CONCAT('%',SearchText , '%') OR Section LIKE  CONCAT('%',SearchText , '%') OR StudentYear LIKE  CONCAT('%',SearchText , '%') OR CLASSCODE LIKE  CONCAT('%',SearchText , '%') OR TEACHER LIKE  CONCAT('%',SearchText , '%') OR ADVISER LIKE  CONCAT('%',SearchText , '%') )
			ORDER BY
				ClassCode;
		ELSE
			SELECT
				*
			FROM 
				vPeriodMashedUp
			WHERE
				Term=Term AND Code=Period AND	 CourseTitle=Course AND	 StudentYear=YearLevel AND Section=Sec AND ClassCode<>'' AND
				(SearchText='' OR Term LIKE  CONCAT('%',SearchText , '%') OR Code LIKE  CONCAT('%',SearchText , '%') OR CourseTitle LIKE  CONCAT('%',SearchText , '%') OR	StudentYear LIKE  CONCAT('%',SearchText , '%') OR Section LIKE  CONCAT('%',SearchText , '%') OR StudentYear LIKE  CONCAT('%',SearchText , '%') OR CLASSCODE LIKE  CONCAT('%',SearchText , '%') OR TEACHER LIKE  CONCAT('%',SearchText , '%') OR ADVISER LIKE  CONCAT('%',SearchText , '%') )
			ORDER BY
				ClassCode;
		END IF;
END$$

