		INSERT INTO tEmployees(EmployeeID, Salutation, LastName, FirstName, MiddleName, PositionID, DepartmentID, Gender,FacultyRankID,SalaryGradeID,CollegeID,Status,Address,DesignationID,EmployeeTypeID)
