CREATE DEFINER=`root`@`192.168.1.177` PROCEDURE `spLibraryDeletebyID` (`IDToDelete` INT, `LibraryToDelete` VARCHAR(50))  BEGIN
	CASE LibraryToDelete
		WHEN 'Student Profiles' THEN
			DELETE from tStudentProfile WHERE ID = IDToDelete;
		WHEN 'Cities' THEN
			DELETE from tCities WHERE ID = IDToDelete;
		WHEN 'Provinces' THEN
			DELETE from tProvinces WHERE ID = IDToDelete;
		WHEN 'Regions' THEN
			DELETE from tRegions WHERE ID = IDToDelete;
		WHEN 'Designations' THEN
			DELETE from tDesignations WHERE ID = IDToDelete;
		WHEN 'Positions' THEN
			DELETE from tPositions WHERE ID = IDToDelete;
		WHEN 'Departments' THEN
			DELETE from tDepartments WHERE ID = IDToDelete;	
		WHEN 'Majors' THEN
			DELETE from tMajors WHERE ID = IDToDelete;	
		WHEN 'Nationalitys' THEN
			DELETE from tNationalities WHERE ID = IDToDelete;		
		WHEN 'Religions' THEN
			DELETE from tReligions WHERE ID = IDToDelete;		
		WHEN 'Scholarships' THEN
			DELETE from tScholarships WHERE ID = IDToDelete;		
		WHEN 'Schools' THEN
			DELETE from tSchools WHERE ID = IDToDelete;		
		WHEN 'Buildings' THEN
			DELETE from tBuildings WHERE ID = IDToDelete;	
		WHEN 'Employees' THEN
        DELETE from tImages WHERE EMPLOYEEID=(Select EmployeeID from temployees where ID=IDToDelete);
			DELETE from tEmployees WHERE ID = IDToDelete;            
		WHEN 'Cities' THEN
			DELETE from tCities WHERE ID = IDToDelete;	
		WHEN 'Courses' THEN
			DELETE from tCourses WHERE ID = IDToDelete;	
		WHEN 'Fees' THEN
			DELETE from tFees WHERE ID = IDToDelete;	
		WHEN 'Rooms' THEN
			DELETE from tRooms WHERE ID = IDToDelete;	
		WHEN 'Subjects' THEN	
			DELETE from tSubjects WHERE ID = IDToDelete;	
		WHEN 'Salary Grades' THEN
			DELETE from tSalaryGrades WHERE ID = IDToDelete;
		WHEN 'Faculty Ranks' THEN
			DELETE from tFacultyRanks WHERE ID = IDToDelete;
		WHEN 'Colleges' THEN
			DELETE from tColleges WHERE ID = IDToDelete;
		WHEN 'Curriculums' THEN
			DELETE from tCurriculums WHERE ID = IDToDelete;
		WHEN 'Subject Details' THEN
			DELETE from tCheckLists WHERE ID = IDToDelete;
            DELETE from tCheckListPrerequisite WHERE CheckListID=IDToDelete;
		WHEN 'Periods' THEN
			DELETE from tPeriodSchedules WHERE PeriodSubjectID=ANY(Select ID from tPeriodSubjects WHERE PeriodSectionID=ANY(Select ID from tPeriodSections Where PeriodCourseID=ANY(Select ID from tPeriodCourses WHERE PeriodID=IDToDelete)));
			DELETE from tPeriodSubjects WHERE PeriodSectionID=ANY(Select ID from tPeriodSections Where PeriodCourseID=ANY(Select ID from tPeriodCourses WHERE PeriodID=IDToDelete));
			DELETE from tPeriodSections WHERE PeriodCourseID=(Select ID from tPeriodCourses WHERE PeriodID=IDToDelete);
			DELETE from tPeriodFees WHERE PeriodCourseID=ANY(Select ID from tPeriodCourses WHERE PeriodID=IDToDelete);
			DELETE from tPeriodCourses WHERE PeriodID=IDToDelete;
			DELETE from tPeriods WHERE ID = IDToDelete;            
		WHEN 'Period Courses' THEN
        	DELETE from tPeriodSchedules WHERE PeriodSubjectID=ANY(Select ID from tPeriodSubjects WHERE PeriodSectionID=ANY(Select ID from tPeriodSections Where PeriodCourseID=IDToDelete));
			DELETE from tPeriodSubjects WHERE PeriodSectionID=ANY(Select ID from tPeriodSections Where PeriodCourseID=IDToDelete);
			DELETE from tPeriodSections WHERE PeriodCourseID=IDToDelete;
			DELETE from tPeriodFees WHERE PeriodCourseID=IDToDelete;
			DELETE from tPeriodCourses WHERE ID = IDToDelete;
		WHEN 'Period Fees' THEN
			DELETE from tPeriodFees WHERE ID = IDToDelete;
		WHEN 'Period Sections' THEN
			DELETE from tPeriodSchedules WHERE PeriodSubjectID=ANY(Select ID from tPeriodSubjects WHERE PeriodSectionID=IDToDelete);
			DELETE from tPeriodSubjects WHERE PeriodSectionID=IDToDelete;
			DELETE from tPeriodSections WHERE ID = IDToDelete;
		WHEN 'ADMIN' OR 'FACULTY' OR 'STUDENT' OR 'PARENT' THEN
			DELETE from tloginverificators WHERE ID = IDToDelete;
END CASE;
END$$

