CREATE DEFINER=`root`@`192.168.1.177` PROCEDURE `spPeriodsAddOREdit` (`AESwitch` INT(11), `PCode` VARCHAR(50), `PTerm` INT(11), `PStart` DATE, `PEnd` DATE, `EStart` DATE, `EEnd` DATE, `ExPrelim` DATE, `ExMidterm` DATE, `ExFinals` DATE, `GStart` DATE, `GEnd` DATE, `SYear` INT, `EYear` INT)  BEGIN
	IF AESwitch= 0 THEN
		IF (SELECT COUNT(ID) FROM TPERIODS WHERE
			PERIODCODE=PCODE AND
            TERMID=PTERM AND
            STARTDATE=PSTART AND
            ENDDATE=PEND AND
            ENROLLMENTSTARTDATE=ESTART AND
            ENROLLMENTENDDATE=EEND AND
            PRELIMDATE=EXPRELIM AND
            MIDTERMDATE=EXMIDTERM AND
            FINALSDATE=EXFINALS AND
            GRADEINPUTSTART=GSTART AND
            GRADEINPUTEND=GEND AND
            STARTYEAR=SYEAR AND
            ENDYEAR=EYEAR)=0 THEN
            INSERT INTO TPERIODS(PERIODCODE,TERMID,STARTDATE,ENDDATE,ENROLLMENTSTARTDATE,ENROLLMENTENDDATE,PRELIMDATE,MIDTERMDATE,FINALSDATE,GRADEINPUTSTART,GRADEINPUTEND,STARTYEAR,ENDYEAR)
            VALUES (PCODE,PTERM,PSTART,PEND,ESTART,EEND,EXPRELIM,EXMIDTERM,EXFINALS,GSTART,GEND,SYEAR,EYEAR);
		END IF;
    else
		IF (SELECT COUNT(ID) FROM TPERIODS WHERE
			PERIODCODE=PCODE AND
            TERMID=PTERM AND
            STARTDATE=PSTART AND
            ENDDATE=PEND AND
            ENROLLMENTSTARTDATE=ESTART AND
            ENROLLMENTENDDATE=EEND AND
            PRELIMDATE=EXPRELIM AND
            MIDTERMDATE=EXMIDTERM AND
            FINALSDATE=EXFINALS AND
            GRADEINPUTSTART=GSTART AND
            GRADEINPUTEND=GEND AND
            STARTYEAR=SYEAR AND
            ENDYEAR=EYEAR)=0 THEN
            UPDATE TPERIODS SET 
			PERIODCODE=PCODE,
            TERMID=PTERM,
            STARTDATE=PSTART,
            ENDDATE=PEND,
            ENROLLMENTSTARTDATE=ESTART,
            ENROLLMENTENDDATE=EEND,
            PRELIMDATE=EXPRELIM,
            MIDTERMDATE=EXMIDTERM,
            FINALSDATE=EXFINALS,
            GRADEINPUTSTART=GSTART,
            GRADEINPUTEND=GEND,
            STARTYEAR=SYEAR,
            ENDYEAR=EYEAR
            WHERE ID=AESWITCH;
		END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`192.168.1.176` PROCEDURE `spPeriodSectionsAddOREdit` (`AESwitch` INT(11), `PCI` INT(11), `SEC` CHAR(5), `AID` INT(11), `SZ` INT(11))  BEGIN
	IF AESwitch= 0 THEN
		if (Select Count(ID) from tperiodSections where PeriodCourseID=PCI
			AND Section=SEC)=0 THEN
            Insert into tperiodsections (PeriodCourseID,Section,AdviserID,ClassSize)
            VALUES (PCI,SEC,AID,SZ);
		END if;
	else
		if (Select Count(ID) from tperiodSections where PeriodCourseID=PCI
			AND Section=SEC)=0 THEN
            UPDATE tperiodsections SET PeriodCourseID=PCI,Section=SEC,AdviserID=AID,ClassSize=SZ
            WHERE ID=AESwitch;
		end if;
    END IF;
END$$

CREATE DEFINER=`root`@`192.168.1.177` PROCEDURE `spPeriodsViewAllORSearch` (`LibraryToLoad` VARCHAR(50), `SearchText` VARCHAR(50), `PeriodToLoad` VARCHAR(50))  BEGIN
	CASE LibraryToLoad
		WHEN 'PERIODS' THEN
			SELECT ID,Code,Term,StartDate,EndDate,EnrollmentStartDate,EnrollmentEndDate,PrelimDate,MidtermDate,FinalsDate,GradeInputStart,GradeInputEnd,StartYear,EndYear FROM vPeriods WHERE SearchText = '' 
			or Code LIKE  CONCAT('%',SearchText , '%')
			or Term LIKE  CONCAT('%',SearchText , '%')
			ORDER BY ID DESC;
		WHEN 'COURSES' THEN
			SELECT ID,PeriodID,PeriodCode,CourseID,CourseCode,ClassCodePrefix,CourseTitle,MajorCode,CollegeCode,NoOfYears,StudentYear,CostPerUnit,ActiveCurriculum,Petition FROM vPeriodCourses WHERE PeriodCode=PeriodToLoad AND (SearchText = '' 
			or CourseCode LIKE  CONCAT('%',SearchText , '%')
			or CourseTitle LIKE  CONCAT('%',SearchText , '%')
			or NoOfYears LIKE  CONCAT('%',SearchText , '%')
			or StudentYear LIKE  CONCAT('%',SearchText , '%')
			or CostPerUnit LIKE  CONCAT('%',SearchText , '%'))
			ORDER BY CourseTitle;
		WHEN 'COURSE REGISTRATION(COURSES)' THEN
			SELECT distinct CourseCode,CourseTitle,MajorCode,NoOfYears,ActiveCurriculum FROM vPeriodCourses WHERE PeriodCode=PeriodToLoad AND (SearchText = '' 
			or CourseCode LIKE  CONCAT('%',SearchText , '%')
			or CourseTitle LIKE  CONCAT('%',SearchText , '%')
			or NoOfYears LIKE  CONCAT('%',SearchText , '%')
			or StudentYear LIKE  CONCAT('%',SearchText , '%')
			or CostPerUnit LIKE  CONCAT('%',SearchText , '%'))
			ORDER BY CourseTitle;
        WHEN 'FEES' THEN
			SELECT ID,PeriodCourseID,FeeID,FeeCode,FeeDescription,FeeCategory,Amount,AppliedToID,AppliedToDescription FROM vPeriodFees WHERE PeriodCourseID=PeriodToLoad AND (SearchText = '' 
			or FeeDescription LIKE  CONCAT('%',SearchText , '%')
			or FeeCategory LIKE  CONCAT('%',SearchText , '%')
			or Amount LIKE  CONCAT('%',SearchText , '%')
			or AppliedToDescription LIKE  CONCAT('%',SearchText , '%'))
			ORDER BY FeeDescription;
		WHEN 'SECTIONS' THEN
			SELECT ID,PeriodCourseID,CourseCode,CourseTitle,MajorCode,Section,AdviserID,Adviser,ClassSize FROM vPeriodSections WHERE PeriodCourseID=PeriodToLoad AND (SearchText = '' 
			or Section LIKE  CONCAT('%',SearchText , '%')
            or Adviser LIKE  CONCAT('%',SearchText , '%')
            or ClassSize LIKE  CONCAT('%',SearchText , '%'))
			ORDER BY Section;
		WHEN 'SUBJECTS' THEN
			SELECT ID,PeriodSectionID,ClassCode,SubjectId,SubjectCode,SubjectDescription,Units,LabUnits,LecUnits,LabHours,LecHours,PreRequisiteCode,SubjectType,SubjectYearDescription,TeacherId,Teacher,Section FROM vPeriodSubjects WHERE PeriodSectionID=PeriodToLoad AND (SearchText = '' 
			or ClassCode LIKE  CONCAT('%',SearchText , '%')
            or SubjectCode LIKE  CONCAT('%',SearchText , '%')
            or SubjectDescription LIKE  CONCAT('%',SearchText , '%')
            or PrerequisiteCode LIKE  CONCAT('%',SearchText , '%')
            or SubjectType LIKE  CONCAT('%',SearchText , '%')
            or Teacher LIKE  CONCAT('%',SearchText , '%'))
            ORDER BY ClassCode;
		WHEN 'SCHEDULES' THEN
			SELECT ID,PeriodSubjectId,ClassCode,SubjectCode,SubjectDescription,Day,StartTime,EndTime,RoomID,RoomCode,Building,College,SessionType,TeacherId,Teacher FROM VPERIODSCHEDULES WHERE PeriodSubjectID IN (SELECT ID from vPeriodSubjects WHERE PeriodSectionID=1); 
	END CASE;
		
END$$

