CREATE DEFINER=`root`@`192.168.1.177` PROCEDURE `spRoomsAddOREdit` (`AESwitch` INT(11), `LibraryToAddEdit` VARCHAR(45), `ParamCode` VARCHAR(50), `ParamDescription` VARCHAR(100), `ParamType` VARCHAR(50), `BID` INT(11), `DID` INT(11))  BEGIN
IF (AESwitch = 0) then
	CASE LibraryToAddEdit
		WHEN 'Add Room' THEN
			IF (SELECT COUNT(ID) FROM tRooms WHERE RoomCode=ParamCode AND RoomDescription = ParamDescription AND RoomType=ParamType AND BuildingID=BID AND CollegeID=DID ) = 0 THEN
				INSERT INTO tRooms(RoomCode,RoomDescription,RoomType,BuildingID,CollegeID) VALUES (ParamCode, ParamDescription,Paramtype,BID,DID);
			END IF;
	END CASE;
else
	CASE LibraryToAddEdit
		WHEN 'Edit Room' THEN
			IF (SELECT COUNT(ID) FROM tRooms WHERE RoomCode=ParamCode AND RoomDescription = ParamDescription AND RoomType=ParamType AND BuildingID=BID AND CollegeID=DID ) = 0 THEN
				UPDATE tRooms SET RoomCode=ParamCode,RoomDescription=ParamDescription,RoomType=ParamType,BuildingID=BID,CollegeID=DID
                WHERE ID=AESwitch;
			END IF;
	END CASE;
END IF;
END$$

CREATE DEFINER=`root`@`192.168.1.177` PROCEDURE `spStudentChecklistsViewAllORSearch` (`LibraryToLoad` VARCHAR(50), `CurriculumID` VARCHAR(50), `StudentID` VARCHAR(20))  BEGIN
CASE LibraryToLoad
	WHEN "Student Checklist" THEN
		    SELECT 
        `csusisdb`.`tchecklists`.`ID` AS `ID`,
        `csusisdb`.`tchecklists`.`CurriculumID` AS `CurriculumID`,
        `csusisdb`.`tchecklists`.`SubjectID` AS `SubjectID`,
        `subj`.`StudentID` AS `StudentID`,
        `csusisdb`.`tsubjects`.`SubjectCode` AS `SubjectCode`,
        `csusisdb`.`tsubjects`.`SubjectDescription` AS `SubjectDescription`,
        `csusisdb`.`tsubjects`.`Units` AS `Units`,
        `csusisdb`.`tchecklists`.`LabUnits` AS `LabUnits`,
        `csusisdb`.`tchecklists`.`LecUnits` AS `LecUnits`,
        `csusisdb`.`tchecklists`.`LabHours` AS `LabHours`,
        `csusisdb`.`tchecklists`.`LecHours` AS `LecHours`,
        `csusisdb`.`tsubjectyears`.`SubjectYearDescription` AS `SubjectYearDescription`,
        `csusisdb`.`tsubjectterm`.`TermDescription` AS `TermDescription`,
        (SELECT 
                GROUP_CONCAT(`csusisdb`.`tchecklistprerequisite`.`SubjectID`
                        SEPARATOR ', ')
            FROM
                `csusisdb`.`tchecklistprerequisite`
            WHERE
                (`csusisdb`.`tchecklistprerequisite`.`ChecklistID` = `csusisdb`.`tchecklists`.`ID`)
            GROUP BY `csusisdb`.`tchecklistprerequisite`.`ChecklistID`) AS `PreRequisiteID`,
        (SELECT 
                GROUP_CONCAT(`a`.`SubjectCode`
                        SEPARATOR ', ')
            FROM
                (`csusisdb`.`tchecklistprerequisite`
                JOIN `csusisdb`.`tsubjects` `a` ON ((`a`.`ID` = `csusisdb`.`tchecklistprerequisite`.`SubjectID`)))
            WHERE
                (`csusisdb`.`tchecklistprerequisite`.`ChecklistID` = `csusisdb`.`tchecklists`.`ID`)) AS `PreRequisiteCODE`,
        `csusisdb`.`tchecklists`.`SubjectType` AS `SubjectType`,
        `subj`.`Grade` AS `Grade`,
         (SELECT 
                COUNT(`csusisdb`.`tchecklistprerequisite`.`SubjectID`)
            FROM
                `csusisdb`.`tchecklistprerequisite`
            WHERE
                (`csusisdb`.`tchecklistprerequisite`.`ChecklistID` = `csusisdb`.`tchecklists`.`ID`)
            GROUP BY `csusisdb`.`tchecklistprerequisite`.`ChecklistID`) AS `Count`
    FROM
        ((((((`csusisdb`.`tchecklists`
        LEFT JOIN (SELECT 
            `csusisdb`.`tstudentgrades`.`ID` AS `ID`,
                `csusisdb`.`tstudentgrades`.`StudentID` AS `StudentID`,
                `csusisdb`.`tstudentgrades`.`SubjectID` AS `SubjectID`,
                `csusisdb`.`tstudentgrades`.`Grade` AS `Grade`,
                `csusisdb`.`tstudentgrades`.`remarks` AS `remarks`
        FROM
            `csusisdb`.`tstudentgrades`
        WHERE
            (`csusisdb`.`tstudentgrades`.`StudentID` = StudentID)) `subj` ON ((`csusisdb`.`tchecklists`.`SubjectID` = `subj`.`SubjectID`)))
        JOIN `csusisdb`.`vcurriculums` ON ((`csusisdb`.`tchecklists`.`CurriculumID` = `vcurriculums`.`ID`)))
        JOIN `csusisdb`.`tsubjects` ON ((`csusisdb`.`tchecklists`.`SubjectID` = `csusisdb`.`tsubjects`.`ID`)))
        JOIN `csusisdb`.`tsubjectyears` ON ((`csusisdb`.`tchecklists`.`SubjectYearID` = `csusisdb`.`tsubjectyears`.`ID`)))
        LEFT JOIN `csusisdb`.`tsubjectterm` ON ((`csusisdb`.`tchecklists`.`SubjectTermID` = `csusisdb`.`tsubjectterm`.`ID`)))
        LEFT JOIN `csusisdb`.`tsubjects` `tsubjects1` ON ((`csusisdb`.`tchecklists`.`ID` = `tsubjects1`.`ID`)))
    WHERE
        (`csusisdb`.`tchecklists`.`CurriculumID` = CurriculumID);
	
END CASE;
END$$

CREATE DEFINER=`root`@`192.168.1.176` PROCEDURE `spStudentProfileAddorEdit` (`AESwitch` INT(11), `TY` VARCHAR(50), `IDN` VARCHAR(50), `LN` VARCHAR(100), `FN` VARCHAR(100), `MN` VARCHAR(100), `BDate` DATE, `BNo` VARCHAR(50), `BMun` VARCHAR(50), `BCoun` VARCHAR(50), `GEN` VARCHAR(50), `REL` VARCHAR(50), `SCHO` VARCHAR(100), `NAT` VARCHAR(50), `FOREIG` INT(11), `PASS` VARCHAR(50), `HNO` VARCHAR(50), `HSTREET` VARCHAR(50), `HMUN` VARCHAR(50), `HCOUN` VARCHAR(50), `CS` VARCHAR(50), `MNO` VARCHAR(50), `EM` VARCHAR(50), `GUARD` VARCHAR(50), `GUARDCONT` VARCHAR(50), `BDNO` VARCHAR(50), `BDSTREET` VARCHAR(50), `BDMUN` VARCHAR(50), `BDCOUN` VARCHAR(50), `R1` INT(11), `R2` INT(11), `R3` INT(11), `R4` INT(11), `R5` INT(11), `R6` INT(11), `R7` INT(11), `R8` INT(11), `R9` INT(11), `R10` INT(11), `R11` INT(11), `R12` INT(11))  BEGIN
	IF AESwitch=0 THEN
			IF (SELECT COUNT(ID) FROM VSTUDENTPROFILES WHERE IDNUMBER=IDN)= 0 THEN
				INSERT INTO TSTUDENTPROFILE VALUES 
				(	0,
					(SELECT ID FROM TSTUDENTTYPE WHERE DESCRIPTION=TY),
					IDN,LN,FN,MN,BDATE,BNO,
					(SELECT ID FROM VCITIES WHERE CITYDESCRIPTION=BMUN),
					(SELECT ID FROM TCOUNTRIES WHERE CountryDescription=BCOUN),
					(SELECT ID FROM TGENDERS WHERE DESCRIPTION=GEN),
					(SELECT ID FROM TRELIGIONS WHERE RELIGIONDESCRIPTION=REL),
					(SELECT ID FROM TSCHOLARSHIPS WHERE ScholarshipDescription=SCHO),
					(SELECT ID FROM TNATIONALITIES WHERE NationalityDescription=NAT),
					FOREIG,PASS,HNO,HSTREET,(SELECT ID FROM VCITIES WHERE CITYDESCRIPTION=HMUN),
					(SELECT ID FROM TCOUNTRIES WHERE CountryDescription=HCOUN),
					(SELECT ID FROM TCIVILSTATUSES WHERE DESCRIPTION= CS),
					MNO,EM,GUARD,GUARDCONT,BDNO,BDSTREET,
					(SELECT ID FROM VCITIES WHERE CITYDESCRIPTION=BDMUN),
					(SELECT ID FROM TCOUNTRIES WHERE CountryDescription=BDCOUN),
					R1,R2,R3,R4,R5,R6,R7,R8,R9,R10,R11,R12
				);	
			END IF;
	ELSE	
		IF (SELECT COUNT(ID) FROM VSTUDENTPROFILES WHERE IDNUMBER=IDN)=0 THEN
			IF (SELECT COUNT(ID) FROM VSTUDENTPROFILES WHERE 	
				TYPE=TY AND	IDNUMBER=IDN AND LASTNAME=LN AND FIRSTNAME=FN AND MIDDLENAME=MN AND
				BITHDATE=BDATE AND BIRTHNO=BNO AND BirthCityDescription=BMUN AND BIRTHCOUNTRYDESCRIPTION=BCOUN AND
				GENDER=GEN AND RELIGIONDESCRIPTION=REL AND SCHOLARSHIPDESCRIPTION=SCHO AND NATIONALITYDESCRIPTION=NAT AND
				FOREIGNER=FOREIG AND PASSPORTNO=PASS AND HOMENO=HNO AND HOMESTREET=HSTREET AND HOMECITYDESCRIPTION=HMUN AND
				HOMECOUNTRYDESCRIPTION=HCOUN AND CIVILSTATUS=CS AND MOBILENO=MNO AND EMAIL=EM AND GUARDIAN=GUARD AND
				GUARDIANCONTACT=GUARDCONT AND BORDINGNO=BDNO AND BORDINGSTREET=BDSTREET AND BORDINGCITYDESCRIPTION=BDMUN AND
				BORDINGCOUNTRYDESCRIPTION=BDCOUN AND F138=R1 AND F137A=R1 AND NSO=R3 AND BC=R4 AND PC=R5 AND
				NBIC=R6 AND  CC=R7 AND CGM=R8 AND MC=R9 AND HD=R10 AND TOR=R11 AND CAT=R12)= 0 THEN
				UPDATE TSTUDENTPROFILE SET 
					TYPE=(SELECT ID FROM TSTUDENTTYPE WHERE DESCRIPTION=TY),
					IDNUMBER=IDN,
					LASTNAME=LN,
					FIRSTNAME=FN,
					MIDDLENAME=MN,
					BITHDATE=BDATE,
					BIRTHNO=BNO ,
					BirthMinucipalityID=(SELECT ID FROM VCITIES WHERE CITYDESCRIPTION=BMUN) ,
					BIRTHCOUNTRYID=(SELECT ID FROM TCOUNTRIES WHERE CountryDescription=BCOUN) ,
					GENDER=(SELECT ID FROM TGENDERS WHERE DESCRIPTION=GEN) ,
					RELIGIONID=(SELECT ID FROM TRELIGIONS WHERE RELIGIONDESCRIPTION=REL) ,
					SCHOLARSHIPID=(SELECT ID FROM TSCHOLARSHIPS WHERE ScholarshipDescription=SCHO) ,
					NATIONALITYID=(SELECT ID FROM TNATIONALITIES WHERE NationalityDescription=NAT) ,
					FOREIGNER=FOREIG ,
					PASSPORTNO=PASS ,
					HOMENO=HNO ,
					HOMESTREET=HSTREET ,
					HomeMinicipalityID=(SELECT ID FROM VCITIES WHERE CITYDESCRIPTION=HMUN) ,
					HOMECOUNTRYID=(SELECT ID FROM TCOUNTRIES WHERE CountryDescription=HCOUN) ,
					CIVILSTATUS=(SELECT ID FROM TCIVILSTATUSES WHERE DESCRIPTION= CS) ,
					MOBILENO=MNO ,
					EMAIL=EM ,
					GUARDIAN=GUARD ,
					GUARDIANCONTACT=GUARDCONT ,
					BORDINGNO=BDNO ,
					BORDINGSTREET=BDSTREET ,
					BORDINGMUNICIPALITYID=(SELECT ID FROM VCITIES WHERE CITYDESCRIPTION=BDMUN) ,
					BORDINGCOUNTRYID=(SELECT ID FROM TCOUNTRIES WHERE CountryDescription=BDCOUN) ,
					F138=R1 ,
					F137A=R1 ,
					NSO=R3 ,
					BC=R4 ,
					PC=R5 ,
					NBIC=R6 ,
					CC=R7 ,
					CGM=R8 ,
					MC=R9 , 
					HD=R10 ,
					TOR=R11 ,
					CAT=R12
				WHERE ID=AESwitch;
			END IF;
		END IF;
	end if;
END$$

